  \"2016-05-02T22:21:11.998280\",\n\t\"name\": \"sonoma-county-ca-2013-lidar\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Sonoma County Vegetation Mapping and LiDAR
  Consortium retained WSI to provide lidar and Orthophoto data and derived products
  in Sonoma County, CA. A classified LAS format point cloud was collected and developed.
  Products, such as bare earth DEMs, were derived from the lidar, but are not covered
  here. The original specified coordinate system for this dataset is California State
  Plane Zone II (FIPS 0402), NAD83 (2011), with units in US Survey Feet for horizontal,
  and vertical units are NAVD88 (12A) US Survey Feet. It was converted to geographic
  coordinates and ellipsoid heights for customized distribution through the Digital
  Coast. The dataset encompasses Sonoma County. The Bare earth DEMs are also available.
  These products have not been reviewed by the NOAA Office for Coastal Management
  (OCM) and any conclusions drawn from the analysis of this information are not the
  responsibility of NOAA, OCM or its partners. The data are available upon request
  via email at: coastal.info@noaa.gov.\",\n\t\"license_title\": null,\n\t\"extras\":
